How is memory safety implemented? This is a case-by-case problem. For example, suppose we want to see how a String is safely passed from Dart to Rust. Then, we need to examine the Dart _api2wire_String and the Rust .wire2api() for it. Indeed String is implemented by delegating to Vec<u8>, so we need to see code related to String as well as Vec<u8>. By simply clicking a few times and jump around code, we will see that: ffi.Pointer<wire_uint_8_list> _api2wire_String(String raw) { return _api2wire_uint_8_list(utf8.encoder.convert(raw));
} ffi.Pointer<wire_uint_8_list> _api2wire_uint_8_list(Uint8List raw) { final ans = inner.new_uint_8_list_0(raw.length); ans.ref.ptr.asTypedList(raw.length).setAll(0, raw); return ans;
} and impl Wire2Api<Vec<u8>> for *mut wire_uint_8_list { fn wire2api(self) -> Vec<u8> { unsafe { let wrap = support::box_from_leak_ptr(self); support::vec_from_leak_ptr(wrap.ptr, wrap.len) } }
} impl Wire2Api<String> for *mut wire_uint_8_list { fn wire2api(self) -> String { let vec: Vec<u8> = self.wire2api(); String::from_utf8_lossy(&vec).into_owned() }
} pub struct wire_uint_8_list { ptr: *mut u8, len: i32,
} In other words, String (or Vec<u8>) is converted to a raw struct with pointer and length field. The memory is manipulated carefully so there is no leak or double free. We use Valgrind to check as well, and I use it in production environment without problems, so no worries about memory problems :)

