And what makes the Api conflict issue more catastrophic? Say you define another Api with parameter String in api_1.rs: pub fn test_string_1(s1: String) { println!("test implicit parameter conflicts {}", s1);
} And then you put another Api with parameter String in api_2.rs: pub fn test_string_2(s2: String) { println!("test implicit parameter conflicts {}", s2);
} These 2 Apis don't violate the uniqueness required by FFI. They should be compilable with no error. But the truth is no! Why? Because for the String parameter, flutter_rust_bridge would automatically generate API like this: #[no_mangle]
pub extern "C" fn new_uint_8_list(len: i32) -> *mut wire_uint_8_list which is used to let rust code easily cooperate with Dart through FFI. So if there are 2 APIs both taking String as parameters over blocks, you should notice a similar panic like "the symbol new_uint_8_list is already defined ..." during compiling( issue #511 ). (Actually, since version 1.37 , even with the separated commands with no Api defined, the whole project is still not compilable with error "symbol free_WireSyncReturnStruct is already defined... ", the symbol free_WireSyncReturnStruct is another implicitly Api generated by flutter_rust_bridge.) So these kinds of explicit/implicit Api conflicts are annoying and frustrating. How to resolve it? Theoretically, the conflict can be detected earlier during generating code, when flutter_rust_bridge knows every detail about API. But the key is that flutter_rust_bridge has to know all Api over all blocks before generating code . That is, with the separated command stated above, flutter_rust_bridge can't do the check for you in practice. Therefore, it is necessary to unite the separated commands into ONE command.

